import Negocios from "./Negocios";
import { Container, Stack } from "react-bootstrap";

const Notas = ({ notas }) => {
  return (
    <Container>
      {notas.map((nota) => (
        <Stack gap={2}>
          <Container className="justify-content-md-center border">
            <Container fluid="sm">
              <h6 key={1}>Nome da Corretora: {nota.corretora}</h6>
              <h6 key={2}>Data das operações: {nota.data}</h6>
              <h6 key={3}>Número da nota: {nota["nr. nota"]}</h6>
              <h6 key={4}>Número da folha: {nota.folha}</h6>
              <h6 key={5}>
                Custos das operações: R$
                {nota.Custos.Total.toLocaleString("pt-br", {
                  minimumFractionDigits: 2,
                })}
              </h6>
            </Container>
          </Container>

          <Negocios negocios={nota.Negocios} />
        </Stack>
      ))}
    </Container>
  );
};

export default Notas;
